class SilentBusWrapper extends HTMLElement {
    isCardInit = false;
    constructor() {
        super();
    }

    set hass(hass) {
        const busElement = this.querySelector('#silent-bus-render');
        if (this.isCardInit && busElement) {
            return;
        }
        // Initialize the content if it's not there yet.
        this.innerHTML = `
          <silent-bus-render id="silent-bus-render"></silent-bus-render>
        `;


        setTimeout(() => {
            const busElement = this.querySelector('#silent-bus-render');
            if (busElement) {
                busElement.myConfig = this.config;
                this.isCardInit = true;
            }})

    }

    setConfig(config) {
        this.config = config;
    }

}

customElements.define('silent-bus', SilentBusWrapper);
